import React, { useState } from "react";

const Nav = () => {
    const [ window, setWindow ] = useState(false);

    let openClose = () => {
        if(window === false) {
            setWindow(true);
        } else {
            setWindow(false);
        }
    };

    return (
        <div className="bg-blue-100 w-full h-11 navbar-menu"> 
        </div>
    );
}

export default Nav;
